DROP TABLE IF EXISTS #__qs_countries;
CREATE TABLE #__qs_countries (
  id int(11) NOT NULL auto_increment,
  codigo char(2) NOT NULL,
  nombre varchar(40) NOT NULL,
  estado char(2) default NULL,
  detalle varchar(40) default NULL,
  lenguaje char(2) NOT NULL,
  PRIMARY KEY  (id)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;


DROP TABLE IF EXISTS #__qs_cities;
CREATE TABLE #__qs_cities (
  id int(11) NOT NULL auto_increment,
  country int(11) NOT NULL,
  iata char(3) NOT NULL,
  ciudad varchar(60) default NULL,
  aeropuerto varchar(60) default NULL,
  idcity int(11) default NULL,
  lenguaje char(2) NOT NULL,
  PRIMARY KEY  (id)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;



DROP TABLE IF EXISTS #__qs_airlines;
CREATE TABLE #__qs_airlines (
  id int(11) NOT NULL auto_increment,
  codigo char(2) NOT NULL,
  nombre varchar(40) NOT NULL,
  PRIMARY KEY  (id)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;

